from collections import deque, defaultdict

def calculate_area_perimeter(matrix, visited, x, y, plant_type):
    queue = deque([(x, y)])
    visited[x][y] = True
    area = 0
    perimeter = 0
    rows, cols = len(matrix), len(matrix[0])
    directions = [(-1, 0), (1, 0), (0, -1), (0, 1)]
    
    while queue:
        cx, cy = queue.popleft()
        area += 1
        for dx, dy in directions:
            nx, ny = cx + dx, cy + dy
            if 0 <= nx < rows and 0 <= ny < cols:
                if matrix[nx][ny] == plant_type and not visited[nx][ny]:
                    visited[nx][ny] = True
                    queue.append((nx, ny))
                elif matrix[nx][ny] != plant_type:
                    perimeter += 1
            else:
                perimeter += 1
    return area, perimeter

def calculate_total_price(matrix):
    rows, cols = len(matrix), len(matrix[0])
    visited = [[False] * cols for _ in range(rows)]
    total_price = 0

    for x in range(rows):
        for y in range(cols):
            if not visited[x][y]:
                plant_type = matrix[x][y]
                area, perimeter = calculate_area_perimeter(matrix, visited, x, y, plant_type)
                total_price += area * perimeter
    return total_price

